export default {
    data() {
        return {
            goodsNumber: 0,
        }
    },
    props: {
        show:Boolean,
        getgoods:String
    },
    mounted() {
        if(localStorage.goods){
            this.goodsNumber = JSON.parse(localStorage.getItem("goods")).length;
        }
    },
    watch: {
        getgoods() {
            const local = JSON.parse(this.getgoods);
            this.goodsNumber = local.length;
        }
    }
}
